/*Bug fix of firefox v57*/
.tp-modal-close {
    overflow: auto;
}
.tp-iframe-wrapper {
    position: relative;
    margin: 50px auto;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.21);
}
.tp-iframe-wrapper.no-shadow {
  box-shadow: unset;
}
.tp-modal {
    overflow-x: hidden;
    overflow-y: scroll !important;
    display: none;
    position: fixed;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    transform: translate3d(0, 0, 0);
}
.tp-modal .tp-message {
    font-family: "Graphik Web Regular", Helvetica, Arial, sans-serif;
    padding: 10px;
}
.tp-modal .tp-btn-container {
    padding-left: 10px;
    padding-bottom: 10px;
}
.tp-cxense-placeholder-modal {
    width: 100%;
    background-color: #fff;
    max-width: 912px;
    display: block;
    overflow: hidden;
    height: auto;
    opacity: 1;
}
.tp-widget-placeholder > div::after {
    display: block;
    content: "";
    clear: both;
}
.tp-btn {
    text-decoration: none;
    cursor: pointer;
    padding: 0 18px;
    line-height: 40px;
    border-collapse: separate;
    border-radius: 4px;
    text-align: center;
    vertical-align: middle;
    display: inline-block;
    color: #fff;
    border: none;
    box-shadow: inset 0 -1px 0 rgba(216, 218, 221, 0.0);
    background: #3878D8;
    background-position: bottom;
    text-shadow: none;
    font-family: "Graphik Web Regular", Helvetica, Arial, sans-serif;
    white-space: nowrap;
    outline: 0;
}
.tp-please-wait.tp-active {
    display: block;
    opacity: .9;
    transition: opacity .25s linear;
}
.tp-please-wait {
    position: absolute;
    top: 0;
    left: 0;
    background-color: #999;
    opacity: 0;
    width: 100%;
    height: 100%;
    display: none;
    text-align: center;
    color: #fff;
    font-weight: lighter;
    font-family: "Open Sans", sans-serif;
    font-size: 15px;
}
.tp-please-wait.tp-overlap {
  position: fixed;
  z-index: 300150;
}
.tp-please-wait > .tp-icon {
    width: 46px;
    height: 46px;
    background-image: url('data:image/gif;base64,');
    margin: 100px auto 20px auto;
}
.tp-please-wait > .tp-icon.tp-centered {
  margin: 0;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
}
.tp-iframe-wrapper.no-width .tp-close,
.tp-iframe-wrapper.no-height .tp-close,
.tp-modal.no-width .tp-close,
.tp-modal.no-height .tp-close {
    display: none;
}

.tp-banner {
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
}

.tp-banner > .tp-container-inner,
.tp-banner > .tp-container-inner > iframe {
  width: inherit !important;
}
