		<h3 class="card-header h6 border border-bottom-0">Origin</h3>




	<div class="single-body card card-body rich-text">

		<p><em><strong>Editorâs Note:</strong> On Aug. 24, 2021, a planned visit to Vietnam by U.S. Vice President Kamala Harris <a href="https://www.usatoday.com/story/news/politics/2021/08/24/vp-harris-vietnam-visit-delayed-possible-case-havana-syndrome/8254594002/" target="_blank" rel="noopener">was delayed</a> after âa report of a recent possible anomalous health incidentâ in Hanoi, according to a news release from the State Department, apparently referring to a suspected case of âHavana Syndrome.â</em></p>
<p class="p1">A mysterious international dispute that threatens the recently thawed diplomatic relationship between the United States and Cuba came to light in a 10 August 2017 story <span class="s1">first&nbsp;</span><a href="https://www.apnews.com/51828908c6c84d78a29e833d0aae10aa" target="_blank" rel="noopener"><span class="s1">reported</span></a> by the <em>Associated Press</em>. The report focused on what has come to be known as the â<a href="https://www.newyorker.com/magazine/2018/11/19/the-mystery-of-the-havana-syndrome" target="_blank" rel="noopener">Havana Syndrome</a>,â a series of seemingly related illnesses suffered by American and Canadian diplomats serving in Cuba. The original reporting included what later appeared to be speculation <a href="http://www.cnn.com/2017/08/20/politics/havana-sonic-attacks/index.html" target="_blank" rel="noopener"><span class="s1">from</span></a> unnamed United States government officials that some form of heretofore unknown sonic weapon was to blame:</p>
<blockquote>
<p class="p3">In the fall of 2016, a series of U.S. diplomats began suffering unexplained losses of hearing, according to officials with knowledge of the investigation into the case. Several of the diplomats were recent arrivals at the embassy, which reopened in 2015 as part of President Barack Obamaâs reestablishment of diplomatic relations with Cuba.</p>
<p>Some of the U.S. diplomatsâ symptoms were so severe that they were forced to cancel their tours early and return to the United States, officials said. After months of investigation, U.S. officials concluded that the diplomats had been attacked with an advanced sonic weapon that operated outside the range of audible sound and had been deployed either inside or outside their residences.</p></blockquote>
<p class="p1">The U.S. State Department later <span class="s1">walked back</span> <a href="http://time.com/4895066/sonic-weapons-cuba/" target="_blank" rel="noopener">claims</a> that they specifically had concluded a sonic weapon was at play, saying through a spokesperson that âwe do not know who or what is causing these incidentsâ. Secretary of State Rex Tillerson has described the incidents as âhealth attacksâ, and Cuba denies any involvement. As <a href="https://www.nytimes.com/aponline/2017/09/17/us/ap-us-united-states-cuba.html?mcubz=1" target="_blank" rel="noopener"><span class="s1">reported</span></a> by the <em>Associated Press</em> on 18 September 2017, the range of symptoms is nonspecific and vague:</p>
<blockquote>
<p class="p3">Of the 21 medically confirmed U.S. victims, some have permanent hearing loss or concussions, while others suffered nausea, headaches and ear-ringing. Some are struggling with concentration or common word recall, the AP has reported. Some victims felt vibrations or heard loud sounds mysteriously audible in only parts of rooms, leading investigators to consider a potential âsonic attack.â Others heard nothing but later developed symptoms.</p>
</blockquote><div id="smg-zone-post-body-1" class="smg-zone smg-zone-post-body-1"><div class="smg-zone-group smg-zone-group-single-body-1"><div class="smg-zone-widget smg-zone-widget-ads-placement  ">		<div class="PlacementWrapper smg-placement" data-ad-placement-id="post-body-1">
			<div class="Placement-placeholder is-hidden">
				<div class="Placement-loader"></div>
			</div>
			<script type="text/javascript">
				smg.ads.load( 'post-body-1' );
			</script>
		</div>
		</div></div></div>
<p class="p1">In sum, the symptoms (none of which are universal to all cases) that have been used in the defense of the claim that a âsonic weaponâ was used are as follows:</p>
<ul>
<li class="p3">Hearing loss</li>
<li class="p3">Nausea, Vertigo, Headaches, Ear-ringing</li>
<li class="p3">Concentration and memory problems</li>
<li class="p3"><span class="s1"><a href="http://www.cnn.com/2017/09/01/politics/foreign-service-cuba-sonic-attacks/index.html" target="_blank" rel="noopener">Brain</a></span> swelling or â<a href="https://www.cbsnews.com/news/some-u-s-diplomats-in-cuba-diagnosed-with-serious-health-conditions-medical-records-show/" target="_blank" rel="noopener"><span class="s1">damage</span></a> to the central nervous systemâ</li>
<li class="p3">âA more serious illness that involved a <a href="https://www.nytimes.com/2017/08/11/world/americas/cuba-united-states-embassy-diplomats-illness.html?mcubz=1" target="_blank" rel="noopener"><span class="s1">blood disorder</span></a>â</li>
</ul>
<p class="p1">Additional clues into the nature of the attack, including the occurrence of an audible noise in some cases, were provided first by a 20 August 2017 <span class="s1">CNN&nbsp;</span><a href="http://www.cnn.com/2017/08/20/politics/havana-sonic-attacks/index.html" target="_blank" rel="noopener"><span class="s1">report</span></a>, reporting that some diplomats heard âa deafeningly loud [but unidentified] sound <a href="http://www.cnn.com/2017/08/20/politics/havana-sonic-attacks/index.html" target="_blank" rel="noopener"><span class="s1">similar</span></a> to the buzzing created by insects or metal scraping across a floorâ. CBS News <a href="https://www.cbsnews.com/news/some-u-s-diplomats-in-cuba-diagnosed-with-serious-health-conditions-medical-records-show/" target="_blank" rel="noopener"><span class="s1">reported</span></a>:</p>
<blockquote>
<p class="p1">Some felt vibrations, and heard sounds â loud ringing or a high-pitch chirping similar to crickets or cicadas. Others heard the grinding noise.</p>
</blockquote>
<p class="p1">The reports of screeching noises in some cases and no noise in most cases initially fed both government and media speculation that a âsilentâ audible device was most likely used (there are ranges of noise close to audible sound that can be heard by some but not others). The two options, then, would be an infrasonic device (below the audible frequency humans hear) or an ultrasonic device (above that range).</p>
<p class="p1">The debate about which brand of inaudible noise would be used generally boils down to this: infrasonic waves capable of affecting humans covertly would need to be extremely close to the victim or unrealistically large, and they would not be able to produce a targeted attack, instead affecting a larger and thus more indiscriminate area. Ultrasonic waves could be targeted, focused, and beamed from further away, but are unlikely to cause a bulk of the symptoms ascribed to them and unless the device was physically touching the victim.</p>
<p class="p1">Before diving into this research, <span class="s1">two&nbsp;</span><a href="http://scienceandglobalsecurity.org/archive/sgs09altmann.pdf" target="_blank" rel="noopener"><span class="s1">variables</span></a> related to sound are necessary to understand what follows. These include the frequency of the noise â&nbsp;defined by the number of waves per unit of time â and also its power, determined by the amount of energy each wave carries. The former is reported in Hz or kHz, with infrasound including noise below 20 Hz, and ultrasound encompassing noise above 20 kHz (20,000 Hz). (The latter is reported in decibels or dB.)</p>
<p class="p1">Below, we detail the main research regarding the primary symptoms discussed in the reporting of the Cuban âhealth attacksâ, finding a.) that the evidence is fairly weak for both ultrasound and infrasound as the cause for a majority of the symptoms listed and b.) that none of the symptoms can be described entirely by either only infrasound or only ultrasound.</p><div id="smg-zone-post-body-2" class="smg-zone smg-zone-post-body-2"><div class="smg-zone-group smg-zone-group-single-body-2"><div class="smg-zone-widget smg-zone-widget-ads-placement  ">		<div class="PlacementWrapper smg-placement" data-ad-placement-id="post-body-2">
			<div class="Placement-placeholder is-hidden">
				<div class="Placement-loader"></div>
			</div>
			<script type="text/javascript">
				smg.ads.load( 'post-body-2' );
			</script>
		</div>
		</div></div></div>
<p class="p1"><b>Hearing Loss </b></p>
<ul>
<li class="p1"><i>Poorly explained by infrasound</i></li>
<li class="p1"><i>Not explained by ultrasound</i></li>
</ul>
<p class="p1">The source most commonly cited in news reports suggesting that <i>infrasound</i> can cause hearing loss is a <span class="s1">2001&nbsp;</span><a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">review</span></a> conducted by the NIH, which stated (with heavy qualification) that research, while sparse, shows âphysical damage to the ear or some loss of hearing has been found in humans and/or animals at levels above 140 dBâ. The 140 dB measurement is no minor omission of detail, as 140 dB infrasonic waves projected covertly at any distance are essentially impossible. The actual studies reviewed in this NIH document generally suggest the opposite: low-frequency, high-power noise will not cause hearing loss, temporary or otherwise, if below the considerably high energy of 150 dB.</p>
<p class="p1"><i>Ultrasonic</i> sound is widely considered to be irrelevant to hearing loss. Another <span class="s1">2001&nbsp;</span><a href="http://scienceandglobalsecurity.org/archive/sgs09altmann.pdf" target="_blank" rel="noopener"><span class="s1">review</span></a> by JÃ¼rgen Altmann, an acoustic weapons expert and physicist at Germanyâs Technische Universitaet Dortmund and who investigated the bulk of the literature up to that time, concluded that at ultrasound âthe ear is essentially untouchedâ if levels are below 140 dB.</p>
<p class="p1"><b>Fatigue, Headaches, Ringing Ears, Vertigo, and Nausea </b></p>
<ul>
<li class="p1"><i>Not explained by infrasound</i></li>
<li class="p1"><i>Inconclusive evidence regarding ultrasound</i></li>
</ul>
<p class="p1">Based on the reviews performed by both the NIH and by Altmann, there is no scientific consensus on fatigue, headaches, ringing ears, or vertigo as they apply to <i>infrasonic</i> noise. The only symptom in this category discussed as a possible result of infrasonic noise is nausea. Per <span class="s1">the </span><a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">NIH</span></a>:</p>
<blockquote>
<p class="p1">There is no agreement about the biological activity of infrasound. Reported effects include [â¦] nausea, vomiting, and bowel spasm.&nbsp;</p>
</blockquote><div id="smg-zone-post-body-3" class="smg-zone smg-zone-post-body-3"><div class="smg-zone-group smg-zone-group-single-body-3"><div class="smg-zone-widget smg-zone-widget-ads-placement  ">		<div class="PlacementWrapper smg-placement" data-ad-placement-id="post-body-3">
			<div class="Placement-placeholder is-hidden">
				<div class="Placement-loader"></div>
			</div>
			<script type="text/javascript">
				smg.ads.load( 'post-body-3' );
			</script>
		</div>
		</div></div></div>
<p class="p1"><a href="http://scienceandglobalsecurity.org/archive/sgs09altmann.pdf" target="_blank" rel="noopener"><span class="s1">Altmann</span></a> (and many others) argued that the gastrointestinal symptoms such as nausea, and bowel spasms in particular, while frequently reported in the press, have been overblown and cannot conclusively be tied to infrasonic sound:</p>
<blockquote>
<p class="p3">The vertigo and nausea effects in the journalistic articles ascribed to intense infrasound cannot be confirmed. On the other hand, low [but still audible] frequencies of 50-100 Hz at 150 to 155 dB caused mild nausea.</p>
</blockquote>
<p class="p1">Many of the above symptoms (headaches, ringing ears, nausea, and fatigue), however, were once referred to in the literature as â<i>ultrasonic</i> sicknessâ. This suite of symptoms and their ties to ultrasonic noise was based on numerous reports from workers in proximity to a variety of ultrasonic devices or tools. Altmann has argued that this literature is hard to interpret as these environments contain significant audible sound, as well. A <span class="s1">2013&nbsp;</span><a href="http://www.tandfonline.com/doi/abs/10.1080/10803548.2013.11076978" target="_blank" rel="noopener"><span class="s1">review</span></a> of the effects of ultrasound on humans makes a similar argument:</p>
<blockquote>
<p class="p3">Many studies confirmed the appearance of subjective symptoms of exposure to noise emitted by ultrasonic devices like dizziness, balance disturbances, tinnitus and fatigue. It is assumed that those symptoms result from the effect of noise on the vestibular system; however, further studies are necessary. [â¦]</p>
<p class="p3">According to the results of studies in the 1960s and 1970s, âaudibleâ components of the noise spectrum are, above all, responsible for subjective symptoms among workers exposed to noise emitted by ultrasonic devices.</p>
</blockquote>
<p class="p1"><b>Concentration and memory problems</b></p>
<ul>
<li class="p1"><i>Poorly explained by infrasound</i></li>
<li class="p1"><i>Poorly explained by ultrasound</i></li>
</ul>
<p class="p1">There are few human studies addressing the neurological effects of <em>infrasonic</em> sound on cognition. Within those, <span class="s1">a few single&nbsp;</span><a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">studies</span></a> demonstrate a connection between infrasound and cognition on humans and animals. Overall, however, most research demonstrates no connection at all, and none have suggested permanent or persistent issues after exposure, as stated in the National Institutes of Healthâs&nbsp;<span class="s1">2001&nbsp;</span><a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">review</span></a>:</p>
<blockquote>
<p class="p3">In several experiments to assess cognitive performance during exposure to infrasound [â¦] no reduction in performance was observed in the subjects. Sole exposure to infrasound at 10 to 15 Hz and 130 to 135 dB for 30 minutes also did not produce changes in autonomic nervous functions.</p>
</blockquote><div id="smg-zone-post-body-4" class="smg-zone smg-zone-post-body-4"><div class="smg-zone-group smg-zone-group-single-body-4"><div class="smg-zone-widget smg-zone-widget-ads-placement  ">		<div class="PlacementWrapper smg-placement" data-ad-placement-id="post-body-4">
			<div class="Placement-placeholder is-hidden">
				<div class="Placement-loader"></div>
			</div>
			<script type="text/javascript">
				smg.ads.load( 'post-body-4' );
			</script>
		</div>
		</div></div></div>
<p class="p1">In terms of <em>ultrasound</em>, the <span class="s1">2013&nbsp;</span><a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">review</span></a> noted that many concentration issues could be associated with the symptoms of âultrasonic sicknessâ without being directly caused by the noise itself:</p>
<blockquote>
<p class="p1">It is worth mentioning that some subjective effects of exposure to ultrasonic noise such as fatigue, headache, discomfort or irritation may disturb human cognitive functions.</p>
</blockquote>
<p class="p1">This body of research refers to the transient appearance of these symptoms when in direct contact with that sound, and makes no suggestion of prolonged memory problems like word recall. Outside of occupational studies that lack relevance to sonic weapon development and by their nature include audible sound as well, there is little evidence in humans to suggest that ultrasound can be the cause for permanent neurological damage.</p>
<p class="p1"><b>Mild Traumatic Brain Injury </b></p>
<ul>
<li class="p1"><i>Poorly explained by infrasound</i></li>
<li class="p1"><i>Not explained by ultrasound</i></li>
</ul>
<p class="p1">Altmann, author of the 2001 review of acoustic weapons, <a href="https://www.nytimes.com/aponline/2017/09/16/us/politics/ap-us-cuba-attacks-medical-mystery.html?mcubz=0" target="_blank" rel="noopener">told</a> the <em>Associated Press</em>:</p>
<blockquote>
<p class="p1">I know of no acoustic effect or device that could produce traumatic brain injury or concussion-like symptoms.</p>
</blockquote>
<p class="p1">The only real mechanism for a damage to the internal organ system such as the brain would be through some sort of powerful internal vibration caused by the strong vibration of the sound waves themselves. Scientists <a href="http://militarymedicine.amsus.org/doi/full/10.7205/MILMED.172.2.182" target="_blank" rel="noopener"><span class="s1">agree</span></a> that this would best be achieved by <i>infrasound</i>, but the evidence that such frequencies could actually make this happen is quite limited and derived almost entirely from studies on animals or <span class="s1">anecdotal&nbsp;</span><a href="http://militarymedicine.amsus.org/doi/full/10.7205/MILMED.172.2.182" target="_blank" rel="noopener"><span class="s1">reports</span></a>.</p>
<p class="p1">A <span class="s1">2009&nbsp;</span><a href="http://militarymedicine.amsus.org/doi/full/10.7205/MILMED.172.2.182" target="_blank" rel="noopener"><span class="s1">review</span></a> published in the journal <i>Military Medicine</i> notes that âremarkable properties have been attributed to infrasound, including the capacity to âdebilitate people for hours and even days,â with âpulsing in their internal organs and blurred vision, both of which can lead to â¦, in rare cases, death,'â but this review also highlights the reality that there are nearly no studies to back up such claims. In fact, studies performed as far back as <a href="http://waubrafoundation.org.au/wp-content/uploads/2015/02/Broner-The-effects-of-low-frequency-noise-on-people.pdf" target="_blank" rel="noopener"><span class="s1">1978</span></a> and as recently as <a href="http://militarymedicine.amsus.org/doi/full/10.7205/MILMED.172.2.182" target="_blank" rel="noopener"><span class="s1">2009</span></a> conclude that an infrasonic weapon used to harm major organ systems would be implausible â if not completely impossible.</p>
<p class="p1">In terms of <i>ultrasound</i>, it is essentially impossible for this kind of energy to penetrate into the human body without direct contact, as the waves dissipate rapidly through the air (and, it should be noted, pretty rapidly within the body as well). Responding to questions that ultrasonic waves could cause brain damage,<span class="Apple-converted-space">&nbsp; </span>Robin Cleveland, a professor of engineering science at the University of Oxford, <a href="https://www.theguardian.com/science/2017/aug/25/how-could-the-sonic-attack-on-us-diplomats-in-cuba-have-been-carried-out" target="_blank" rel="noopener"><span class="s1">told</span></a> the <i>Guardian </i>he doesnât buy it: âThe sound would have to enter the brain tissue itself [â¦]. If thereâs even a tiny bit of air between the sound and your body it doesnât get through.â</p>
<p class="p1"><b>Blood Disorders</b></p>
<ul>
<li class="p1"><i>Not enough information<br>
</i></li>
</ul>
<p class="p1">Without knowing more than that a victim experienced âa more serious illness that involved a blood disorderâ it is hard to confidently assess plausibility of this this kind of disease except to say that the reasons ultrasonic noise do not explain brain damage would likely hold for any illness that requires sound to penetrate into the body. According to <a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">the NIH</span></a>, the most consistently reported effect of infrasonic noise (though the mechanisms remains unclear) seem to be changes in blood pressure and respiratory rate, which could perhaps be linked to other diseases indirectly. There is no existing evidence that links noise of any kind to the development of a blood disorder.</p>
<p class="p1"><b>In the End, Neither Infrasound or Ultrasound Work as an Explanation</b></p>
<p class="p1">Taking even the most tenuous scientific research at face value, an ultrasonic device could be responsible for the <i>transient</i> occurrence of fatigue, headaches, ringing ears, vertigo, and nausea and (even more dubious) concentration and memory issues. Taking a similarly loose approach for infrasound, this kind of noise could cause hearing loss, nausea, and (most dubiously) some form of organ discomfort or damage. Neither can explain all of the symptoms.</p>
<p class="p1">Further, there is no real way to create a covert version of either device. F. Joseph Pompei, a former MIT researcher and current chief executive officer of a company that <a href="https://www.holosonics.com/" target="_blank" rel="noopener"><span class="s1">develops</span></a> devices that focus sound into narrow, targeted beams, told us that a focused or controllable beam of 20Hz (infrasonic) sound would require an array of subwoofers âthe size of a stadiumâ.&nbsp;</p>
<p class="p1">Conversely, he told us, for an ultrasonic device to penetrate into the body at all, the victim would either have to be submerged in water or have the device in physical contact (both conditions would allow those waves to pass into the body without reflecting off it). This, as well, seems unlikely to be a covert choice for an attack.</p>
<p class="p1">âIt sounds very appealing and interesting, but I find it hard to believe that there actually is such a device,â &nbsp;<a href="http://keck.usc.edu/john-s-oghalai-to-lead-otolaryngology/" target="_blank" rel="noopener"><span class="s1">John Oghalai</span></a>, Chair of the Caruso Department of Otolaryngology â Head and Neck Surgery at the University of Southern California, <a href="https://www.theverge.com/2017/9/16/16316048/sonic-weapon-cuba-us-canadian-diplomats-ultrasound-infrasound-science" target="_blank" rel="noopener"><span class="s1">told </span></a><i>The Verge</i>.</p>
<p class="p1">Collectively, the scientific research â which in <a href="https://ntp.niehs.nih.gov/ntp/htdocs/chem_background/exsumpdf/infrasound_508.pdf" target="_blank" rel="noopener"><span class="s1">many</span></a> <a href="http://scienceandglobalsecurity.org/archive/sgs09altmann.pdf" target="_blank" rel="noopener"><span class="s1">cases</span></a> <a href="http://militarymedicine.amsus.org/doi/full/10.7205/MILMED.172.2.182" target="_blank" rel="noopener"><span class="s1">notes</span></a> that anecdotal and inaccurate reports in newspapers have long obfuscated the actual science behind the plausibility of such a device â demonstrates that no single brand of sound could create the range of symptoms described by the victims of the Cuban health attacks, and even if they could, a covert device would be hard if not impossible to design. As such we rank the <i>specific claim</i> that an inaudible sonic device adequately explains the health attacks in Cuba as false.</p>
<p>On 1 September 2018, the <i>New York Times</i> <a href="https://www.nytimes.com/2018/09/01/science/sonic-attack-cuba-microwave.html" target="_blank" rel="noopener">reported</a> on a theory the government is said to be considering as a cause of the health attacks on American and other diplomats in Cuba: focused beams of microwave energy that can cause both brain damage and the perception of noises when such noises do not exist. This effect, the <i>Times</i> reported, has been known to science since 1961 as the Frey effect or the microwave auditory effect. In a 2017 paper, electrical engineering professor James Lin <a href="http://sci-hub.tw/10.1109/MMM.2017.2765778" target="_blank" rel="noopener">suggested</a> this phenomenon could explain the events in Havana:</p>
<blockquote><p>Some readers may find it preposterous or astonishing that auditory perception of (or hearing) microwave pulses is possible. So let me explain. Studies have shown that the auditory phenomenon occurs at a microwave radiation specific-energy-absorption rate threshold of 1.6 W/g for a single 10-Î¼s-wide pulse of microwaves aimed at the subject or subjectâs head, for example. Most significantly, high-power microwave pulses may be covertly delivered remotely, so that only the intended target would perceive the sound in his or her own head â¦</p>
<p>Depending on the intensity of the impinging microwave pulses, the level of induced sound pressure could be considerably above the threshold of auditory perception at the cochleaâ approaching or exceeding levels of discomfort (including the reported headaches, ringing in the ears, nausea, and problems with balance or vertigo) and even causing potential tissue injury.</p></blockquote>
<p>Douglas H. Smith, the lead author on a March 2018 paper about the Cuban health attacks and the director of the Center for Brain Injury and Repair at the University of Pennsylvania, said that âmicrowaves were now considered a main suspect.â The <i>Times</i> also cited âa secretive group of elite scientists that helps the federal government assess new threats to national securityâ assuggesting that the microwave theory is among those being considered. The weaponization of this technology, the <i>Times</i> reported, has been of interest to both the United States and the former Soviet Union.</p>
<p>The Cuban government, via a CNN <a href="https://www.cnn.com/2018/09/03/health/cuba-microwaves-attacks-theory/index.html" target="_blank" rel="noopener">interview</a> with a member of the Cuban task force investigating the attacks, has pushed back against this theory, suggesting it belongs in the realm of science fiction and that it is inconsistent with the reported circumstances described by the victims:</p>
<blockquote><p>âIf you look at the alleged events, there have been reports that there are several people in a room with thick walls and thick windows and only one person was targeted. This is a kind of weapon that doesnât exist,â said Dr. Mitchell Valdes-Sosa, a well-known neurologist who is part of the Cuban special task force investigating the alleged attacks. âItâs science fiction, not science,â he said.</p>
<p class="p3">âFirst, it was sonic weapons, now microwave. Whatâs next, kryptonite?â the investigator said in an interview with CNN at his research center in Havana, referring to an earlier theory that sonic weapons emitting high-powered ultrasound waves could have caused the injuries.</p>
</blockquote>
<p>We note an apparent conflict between reports of actual audio recordings of the attack that were <a href="https://www.apnews.com/88bb914f8b284088bce48e54f6736d84" target="_blank" rel="noopener">published</a> by the Associated Press in October 2017 and the general conclusion that the microwave auditory effects register only in the brains of the victims and not in a way that is detectable by traditional recording equipment. CNN reported that the Cuban government is currently working on a rebuttal to the microwave theory.</p>


	</div>

















	

